DROP TABLE IF EXISTS `top_university_info`;
CREATE TABLE `top_university_info` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `top_university_name` varchar(255) DEFAULT NULL,
  `top_university_level` varchar(255) DEFAULT NULL,
  `top_university_type` varchar(255) DEFAULT NULL,
  `top_university_address` varchar(255) DEFAULT NULL,
  `top_university_addmission_tel` varchar(255) DEFAULT NULL,
  `top_university_addmission_website` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2511 DEFAULT CHARSET=utf8;


